class VipCardComponent {
    constructor(cookie, user) {
        this.cookie = cookie;
        this.user = user;
        this.isVisible = false;
        this.isOkLoading = false;
    }
    ngOnInit() {
        this.user.getUserVipCard(JSON.parse(this.cookie.get('userMsg'))['id'])
            .subscribe(res => {
            if (res['success']) {
                console.log(res['content']);
                this.id = res['content']['id'];
                this.balance = res['content']['balance'];
                this.joinDate = res['content']['joinDate'].slice(0, 10);
            }
        });
    }
    updateMsg() {
        this.user.getUserVipCard(JSON.parse(this.cookie.get('userMsg'))['id'])
            .subscribe(res => {
            if (res['success']) {
                console.log(res['content']);
                this.id = res['content']['id'];
                this.balance = res['content']['balance'];
                this.joinDate = res['content']['joinDate'].slice(0, 10);
            }
        });
    }
    showModal() {
        this.isVisible = true;
    }
    handleOk() {
        this.isOkLoading = true;
        setTimeout(() => {
            this.isVisible = false;
            this.isOkLoading = false;
        }, 3000);
    }
    handleCancel() {
        this.isVisible = false;
    }
}
